[{"location":"","page":"-","title":"-","text":"PLL\nPLL()","category":"page"},{"location":"#PllToolbox.PLL","page":"-","title":"PllToolbox.PLL","text":"PLL\n\nLinear time invariant (LTI) PLL model, based on a continuous-time approximation [1]. The PLL model has the following structure:\n\n   ┏━━━━━━┓   ┏━━━┓   ┏━━━━━━━━┓       ┏━━━━━━┓\n───┨ I(s) ┠───┨ + ┠───┨  L(s)  ┠───┬───┨ O(s) ┠───\n   ┗━━━━━━┛   ┗━┯━┛   ┗━━━━━━━━┛   │   ┗━━━━━━┛\n              ─ │     ┏━━━━━━━━┓   │\n                └─────┨  F(s)  ┠───┘\n                      ┗━━━━━━━━┛\n\nwhere I(s), L(s), F(s) and O(s) represent the input, feedforward, feedback and output  transfer functions, respectively. An additional closed-loop transfer function, G(s), is  formed by the feedback network of L(s) and F(s):\n\n   L(s)\n──────────\n1+L(s)⋅F(s)\n\nEach branch is made up of a set of zero or more instances of Block. \n\n[1] TODO! Get reference\n\n\n\n\n\n","category":"type"},{"location":"#PllToolbox.PLL-Tuple{}","page":"-","title":"PllToolbox.PLL","text":"PLL()\n\nCreate an example PLL model.\n\n\n\n\n\n","category":"method"}]
